import React from 'react';
import './Table.css';

const Table = ({ columnNames, rows }) => {
    const reversedColumnNames = columnNames.slice().reverse(); // Create a copy of columnNames and reverse it

    return (
        <table className='table'>
            <thead>
                <tr>
                    {reversedColumnNames.map((columnName, index) => (
                        <th key={index}>{columnName}</th>
                    ))}
                </tr>
            </thead>
            <tbody>
                {rows.map((row, rowIndex) => (
                    <tr key={rowIndex}>
                        {reversedColumnNames.map((columnName, columnIndex) => (
                            <td key={columnIndex}>{row[columnName]}</td>
                        ))}
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default Table;
